import React from "react";


const Results: React.FC<{
  id: string,
  title: string,
  note: string,
  link: string,
  date: string,
  onDelete: Function
}> = (notes) => {
  const deleteHandler = () => {
    notes.onDelete(notes.id);
  };

  return (
<>

            <span classename="datenote">{notes.date}</span>
            <h4 color="light"> {notes.title} </h4>
            <p>{notes.note}</p>

              <a href={notes.link}>{notes.link}</a>

            <button color="success" onClick={deleteHandler}>
              Done
            </button>
            {/* <h2>{props.task}</h2> */}
            {/* <h3></h3> */}
            <hr/>
</>
  );
};

export default Results;
